import React from 'react'
import './register.css'
import axios from '../../axios'
import {useHisto}from "react-router-dom"
 function Register() {
  
   const handleSubmit=async(e)=>{
      const history = useHistiry()
      e.preventDefault()
      const form=e.target

      const formData= new FormData(form)
      let data=Object.fromEntries(formData)
      if (Object.values(data).some((value) => value)) {
         try {
            const response = await axios.post('/register', data);
            console.log(response.data);
            history.push('/restaurant-addmenu')
         } catch (error) {
            console.error(error);
         }
      }
   }
  return (
    <div className='conatiner'>
      <div className='row'>
         <div className='img'>
           <h1>Partner with Us</h1>
           <span>Get listed on India's leading online food delivery marketplace today</span>
         </div>
            
            <div className='registration-form'>
               <form action="" onSubmit={handleSubmit}>
                <h2>Restaurant Information</h2>
                 <div className='info'>
                    <label htmlFor="">Restaurant Name</label>
                    <input type="text" name='RestaurentName'/>
                 </div>
                 <div className='info'>
                    <label htmlFor="">Restaurant Address</label>
                    <input type="text" name='RestaurantAddress' />
                 </div>
                 <div className='info'>
                    <label htmlFor="">Owner Number</label>
                    <input type="text" name='OwnerNumber'/>
                 </div>
                 <div className='info'>
                    <label htmlFor="">Cuisine Type</label>
                    <input type="text" name='CuisineType'/>
                 </div>
                 <input type="submit" value="Add Restaurent" />
               </form>
            </div>
      </div>
    </div>
  )
}

export default Register
